-- 테이블 dataset.car_info 구조 내보내기
CREATE TABLE IF NOT EXISTS `car_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `REG_NO` varchar(50) DEFAULT NULL COMMENT '차량번호',
  `MT_ID` varchar(50) DEFAULT NULL COMMENT '측정아이디',
  `OWNER_NAME` varchar(100) DEFAULT NULL COMMENT '소유자',
  `MODEL_NAME` varchar(100) DEFAULT NULL COMMENT '차량모델명',
  `FUEL_CD` varchar(20) DEFAULT NULL COMMENT '연료코드',
  `FUEL_NAME` varchar(50) DEFAULT NULL COMMENT '연료명',
  `CLASS` varchar(50) DEFAULT NULL COMMENT '등급',
  `MODEL_YR` varchar(4) DEFAULT NULL COMMENT '모델연도',
  `VE_TYPE` varchar(50) DEFAULT NULL COMMENT '차량유형',
  `MNFACR` varchar(100) DEFAULT NULL COMMENT '제조사영문',
  `MNFACR_KOR` varchar(100) DEFAULT NULL COMMENT '제조사한글',
  `VIN` varchar(50) DEFAULT NULL COMMENT '차대번호',
  `ME_ID` varchar(50) DEFAULT NULL COMMENT '단말기아이디',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- 테이블 데이터 dataset.car_info:~16 rows (대략적) 내보내기

